                            <div className="form-group">
                                <label htmlFor="conducta_destino">Tipo de conducta<span className="text-danger">*</span></label>
                                <Field value={estado} onChange={event => handleInputChange(event, 13)} as="select" className="form-control" 
                                    id="conducta_destino" name="conducta_destino">
                                    <option value="">Por favor seleccione</option>
                                    {existeListaEstados ? listaEstados() : null}
                                </Field>
                            </div>
                        </div>
                          
                        </>
                    )
                })
            )
        }
    }

    const enviarDatos = (datos) => {

        window.showSpinner(true);

        let data;

        data = {
            "data": {
                "type": 'migracion',
                "attributes": {
                    "id_temp_proceso_disciplinario":datos.radicado_destino+'-'+datos.vigencia_destino,
                    "radicado_original": radicado,
                    "vigencia_original": vigencia,
                    "radicado": radicado,
                    "vigencia": vigencia,
                    "id_tipo_proceso": datos.tipo_proceso_destino,
                    "id_etapa": datos.etapa_destino,
                    "id_dependencia_origen": datos.depedencia_destino,
                    "id_dependencia_duena": datos.dependencia_duena_destino,
                    "fecha_registro": datos.fecha_registro,
                    "estado": estado,
                }
            }
        }

        console.log(JSON.stringify(data));

        GenericApi.addGeneric("migrar-proceso-disciplinario",data).then(
            datos => {
                if (!datos.error) {
                    setModalState({ title: "Proceso No "+radicado+" :: Migrar Proceso Disciplinario", message: 'Registro Exitoso', show: true, redirect: `/ProcesoDisciplinarioMigracion/${radicado}/${vigencia}`, alert: global.Constants.TIPO_ALERTA.EXITO});
                }
                else {
                    setModalState({ title: "Proceso No "+radicado+" :: Migrar Proceso Disciplinario", message: datos.error.toString(), show: true, redirect: `/CargarMigracionProcesoDisciplinario/${radicado}/${vigencia}`, alert: global.Constants.TIPO_ALERTA.ERROR });
                }
                window.showSpinner(false);

            }
        )
    }

    return (
        <>
            {<Spinner />}   
            {<ModalGen data={getModalState} />}
          
            <Formik
                initialValues={{
                    radicado_destino: getRadicado,
                    vigencia_destino: getVigencia,
                    etapa_destino: etapa,
                    depedencia_destino: dependenciaOrigen,
                    dependencia_duena_destino: ubicacionExpediente,
                    registrado_por: registradoPor,
                    fecha_registro: fechaRegistro,
                    tipo_proceso_destino: tipoProceso

                }}
                enableReinitialize
                validate={(valores) => {
                    let errores = {}

                    return errores
                }}
                onSubmit={(valores, { resetForm }) => {
                    enviarDatos(valores);
                }}
            >

                {({ errors }) => (
                    <Form>

                        <div className="w2d_block">
                            <nav aria-label="breadcrumb">
                                <ol className="breadcrumb breadcrumb-alt push">
                                    <li class="breadcrumb-item"> <Link underline="hover" className="text-dark" to={`/Buscador`}><small>Buscador</small></Link></li>
                                    <li class="breadcrumb-item"> <Link underline="hover" className="text-dark" to={`/ProcesoDisciplinarioMigracion/${radicado}/${vigencia}`}><small>Inicio proceso de migracin</small></Link></li>
                                    <li class="breadcrumb-item"> <small>Proceso Disciplinario</small></li>
                                </ol>
                            </nav>
                        </div>
                      
                        <div className="block block-themed">
                            <div className="block-header">
                                <h3 className="block-title">Proceso No. {radicado} - {vigencia} :: Detalles del proceso </h3>
                            </div>

                            <div className="block-content">

                                <div className='text-right w2d-enter'>                                
                                    <Link to={`/ProcesoDisciplinarioMigracion/${radicado}/${vigencia}`} title='Regresar' >
                                        <button type="button" className="btn btn-success"><i className="fas fa-backward"></i> </button>
                                    </Link>
                                </div>

                                <div className="row">

                                    {infoProceso()}
                                    
                                </div>

                            </div>
                            <div className="block-content block-content-full text-right bg-light">
                                <button type="submit" className="btn btn-rounded btn-primary">Registrar</button>

                                <Link to={`/AntecedentesLista/`}>
                                    <button type="button" className="btn btn-rounded btn-outline-primary">Cancelar</button>
                                </Link>
                            </div>
                        </div>
                    </Form>
                )}
            </Formik>
        </>
    );
}


export default ProcesoDisciplinarioMigracionForm;
